import { SORT_DIRECTION } from 'shared/constants/stringConstantsSelectors';

export const initialState = {
    userSettings: {
        collection: {
            viewType: {
                tableView: false,
                cardView: true,
            },
        },
        realImages: false,
        sort: SORT_DIRECTION.ASC,
        demo: true,
    },
    dataSet: {
        displayedData: [],
        productType: undefined,
        productLine: undefined,
        sortAttribute: undefined,
    },
    notifications: {
        list: [],
        isOpen: false,
    },
    features:{
        enableNotificationDrawer: false,
    },
};
